 Nhà hẻm Hòa Hưng, quận 10. 35 m2, 3P ngủ, Chỉ 5,4 tỷ 
Nhà hẻm Hòa Hưng, quận 10. 35 m2, 3P ngủ, Chỉ 5,4 tỷ MR1208211: Nhà hẻm Hòa Hưng, phường 12, quận 10. Đang cho thuê 12 triệu/ tháng. + Vị trí: nhà 2 mặt hẻm ba gác, cách hẻm xe tải tránh tầm 20m, thông khắp nơi. Khu dân trí cao, hẻm an ninh tốt. Bán kính 100m đầy đủ tiện ích: trường học, chợ,… + Diện tích: 35 m2 (3,5m x 10m). Sổ vuông đẹp, không lộ giới. + Xây dựng 1 trệt 2 lầu đúc có sân thượng phía trước thoáng mát. Nội thất đầy đủ như hình ảnh gửi kèm. + 1 phòng khách, 3 phòng ngủ, 3 WC, sân trồng cây và sân phơi. + Chủ đang vay ngân hàng, cần bán rất gấp 5,4 tỷ. Vui lòng liên hệ 0903266807 để được tư vấn và xem nhà miễn phí. 
 #bannhahem133ho ahungquan10; #bannhahem91hoa hung; #bannhaduonghoa hungphuong12qua n10;
